import React from 'react'
import { Link } from 'react-router-dom';

const Navebar = () => {
    return (
        <div className="flex items-center justify-between p-4 bg-white shadow-md">
            <span className="text-2xl font-bold text-gray-800 hover:text-blue-500 transition-colors duration-300">
                <Link to="/">E-commerce</Link>
            </span>
            <nav className="space-x-4">
                <Link to="/" className="text-gray-600 hover:text-blue-500">Home</Link>
                <Link to="/bout" className="text-gray-600 hover:text-blue-500">About</Link>
                {/* <Link to="/products" className="text-gray-600 hover:text-blue-500">Products</Link>
                <Link to="/contact" className="text-gray-600 hover:text-blue-500">Contact</Link> */}
            </nav>
        </div>
    )
}

export default Navebar
